DROP TABLE IF EXISTS `estudiante`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `estudiante` (
  `cod_es` int NOT NULL AUTO_INCREMENT,
  `nombre_es` char(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `ap_es` char(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `am_es` char(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `titulo_bachiller` char(10) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `ci` int DEFAULT NULL,
  `pais_es` char(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `departamento` char(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `provincia` char(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `ciudad` char(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `region` char(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `sexo` char(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `cod_area` int DEFAULT NULL,
  `cod_carrera` int DEFAULT NULL,
  `cod_grado` int DEFAULT NULL,
  `estado` char(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `fecha` date DEFAULT NULL,
  PRIMARY KEY (`cod_es`),
  KEY `cod_carrera` (`cod_carrera`),
  KEY `cod_area` (`cod_area`),
  KEY `cod_grado` (`cod_grado`),
  CONSTRAINT `estudiante_ibfk_1` FOREIGN KEY (`cod_carrera`) REFERENCES `carrera` (`cod_carrera`),
  CONSTRAINT `estudiante_ibfk_2` FOREIGN KEY (`cod_area`) REFERENCES `area` (`cod_area`),
  CONSTRAINT `estudiante_ibfk_3` FOREIGN KEY (`cod_grado`) REFERENCES `grado` (`cod_grado`)
) ENGINE=InnoDB AUTO_INCREMENT=81 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
